import PropTypes from 'prop-types';
import '../App.css';


export default class Skill extends Component {


  render() {
    const { skill_id, skill_title, skill_details, skill_icon} = this.props.skill;

    return (
      <div>
          <div className="skill">
                {skill_title}  <img src={skill_icon} className="skill_icon" /> 
             </div>

      </div>
    )
  }
}





